#include <iostream>
#include <algorithm>
#include <string>
#include <set>
#include <iterator>


class Solution {
public:
	int lengthOfLongestSubstring(const std::string& s) {
		unsigned long long result = 0;
		std::string counter;
		for (size_t index = 0; index < s.size(); ++index) {
			std::size_t pos = counter.find_first_of(s[index]);
			counter.push_back(s[index]);
			if (pos == std::string::npos) {
				if (result < counter.size())
					result = counter.size();
			}
			else
				counter.erase(0, pos + 1);
		}
		return static_cast<int>(result);
	}
};

